import './Dashboard.css'
import React from 'react'
import { Link } from 'react-router-dom'
const Note = ({ note }) => {
  const { _id, title, body } = note
  const onNoteClick = (id) => {
    <Link to={`${'/id'}`} />
  }
  return (
    <div className='note-container' onClick={(e) => onNoteClick(_id)}>
      Title: {title}
      Body: {body}
    </div>
  )
}

export default Note
